	add("latecomer", "{\"term\":\"latecomer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who has arrived comparatively recently\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The old families in the neighborhood look down on him as a \u0027\u0027latecomer\u0027\u0027, his family only arrived in the 18th century, too nouveau for them\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One who arrived late\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"At the party the host made a point of greeting all the \u0027\u0027latecomers\u0027\u0027 he missed in the first pass\", \"priority\":4}]}, \"synonyms\":{}}");

