	add("latigo", "{\"term\":\"latigo\", \"etymology\":{\"influencers\":[], \"languages\":[\"Catalan\", \"English\", \"Spanish\", \"gothic\", \"Portuguese\"], \"text\":\"From Spanish \u0027l√°tigo\u0027 (whip) from Catalan or Portuguese \u0027l√°tego\u0027 (whip) probably from Gothic {{m|got|*êåªêå∞êåπêçÑêçÑêåøêå≤|tr\u003dlaittug}}, cognate with Old English {{m|ang|lƒÅttƒìh}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A strap used to tighten a cinch\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1989\u0027\u0027, Hal Borland, \u0027When the Legends Die\u0027, 2011, [http://books.google.com.au/books?id\u003d7hgC0N7Rdn0C\u0026amp;pg\u003dPT146\u0026amp;dq\u003d%22latigos%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d39ZdU_zcMcfSkwWD74DgDA\u0026amp;ved\u003d0CEQQ6AEwA\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22latigos%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He looked at the saddle and saw that both \u0027\u0027latigos\u0027\u0027, the straps that held the cinches, were broken. Both were old \u0027\u0027latigos\u0027\u0027 instead of the good new ones that had been on the saddle the day before, and both had been cut halfway through with a knife\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Cormac McCarthy, \u0027The Crossing\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Then they tightened the \u0027\u0027latigos\u0027\u0027 on their horses and mounted up\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027 [1938], Victor M. Linoff (editor), \u0027Saddle and Western Gear Catalog, 1938\u0027, [http://books.google.com.au/books?id\u003dvD9U9qRmxzgC\u0026amp;pg\u003dPA41\u0026amp;dq\u003d%22latigoes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dBtJdU4H4C86lkgW5jYCACw\u0026amp;redir_esc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22latigoes%22\u0026amp;f\u003dfalse page 41\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"These prices are for saddle with single cinch and two \u0027\u0027latigoes\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Linda Aksomitis, \u0027Longhorns and Outlaws\u0027, [http://books.google.com.au/books?id\u003dfMSYXr2PQjkC\u0026amp;pg\u003dPA21\u0026amp;dq\u003d%22latigoes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dBtJdU4H4C86lkgW5jYCACw\u0026amp;redir_esc\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22latigoes%22\u0026amp;f\u003dfalse page 21\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"quot;How am I supposed to learn if you aren\u0027t clear?\u0026quot\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"quot;Watch. These metal rings beside the saddle tree are the rigging rings. These long leather straps hanging on \u0027em are the \u0027\u0027latigoes.\u0027\u0027 Leave the off-side \u0027\u0027latigo\u0027\u0027 done up and use the near-side strap.\u0026quot\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Gincy Self Bucklin, \u0027The Gentle Art of Horseback Riding\u0027, [http://books.google.com.au/books?id\u003d_TM7vcB8vY4C\u0026amp;pg\u003dPA142\u0026amp;dq\u003d%22latigo%22%7C%22latigos%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dqMpdU_HxCoWekwXMuIGgCw\u0026amp;redir_esc\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22latigo%22%7C%22latigos%22\u0026amp;f\u003dfalse page 142\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Cinches fasten with a \u0027\u0027latigo\u0027\u0027 strap that is already attached to the saddle, using a special flat knot. Make sure the strap has no twists in it, then insert it through the cinch ring from inside to outside (figure 13.4a\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Cynthia McFarland, \u0027The Horseman\u0027s Guide to Tack and Equipment: Form, Fit and Function\u0027, [http://books.google.com.au/books?id\u003dHp_2CANYU5wC\u0026amp;pg\u003dPA69\u0026amp;dq\u003d%22latigo%22%7C%22latigos%22%7C%22latigoes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d7c5dU5K1DYuikwXdj4A4\u0026amp;redir_esc\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22latigo%22%7C%22latigos%22%7C%22latigoes%22\u0026amp;f\u003dfalse page 69\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027double-roller\u0027\u0027 functions like a pulley system in that the \u0027\u0027latigo\u0027\u0027 runs through the top roller and then down and through a bottom roller.Most riders today use \u0027\u0027latigos\u0027\u0027 on the left side to tighten the cinch and off-billets on the right, but some horsemen still prefer to use \u0027\u0027latigos\u0027\u0027 on both sides\", \"priority\":19}]}, \"synonyms\":{}}");

